DROP TABLE IF EXISTS international_student_application;
CREATE TABLE international_student_application
(
  Id INT PRIMARY KEY,
  Name VARCHAR(100) NOT NULL,
  Application_Deadline_Fall VARCHAR(10), 
  Application_Deadline_Spring VARCHAR(20),
  Separate_Application_Form_Rrequired VARCHAR(10),
  Conditional_Admission_Offered VARCHAR(10),
  TOEFL_Accepted_Instead_Of_SAT_Or_ACT VARCHAR(10),
  Minimum_TOEFL_Score_Required VARCHAR(10),
  Average_TOEFL_Score_Required VARCHAR(10),
  Minimum_IELTS_Score_Required VARCHAR(10),
  Average_IELTS_Score_Required VARCHAR(10),
  International_Students_Applying INT,
  International_Students_Accepted INT,
  International_Freshmen_Enrolled INT,
  Intl_Financial_Aid VARCHAR(25),
  Contact varchar(250),
  Note           varchar(150)  
);

